const exportToPDF = async (data, filename = 'export.pdf')=>{
    try {
        // For PDF export, we'll create a simple text-based report for now
        // In a production environment, you'd use libraries like jsPDF or Puppeteer
        let content = `${filename}\n${'='.repeat(50)}\n\n`;
        content += `Generated: ${new Date().toLocaleString()}\n`;
        content += `Total Records: ${data.length}\n\n`;
        data.forEach((item, index)=>{
            content += `${index + 1}. ${JSON.stringify(item, null, 2)}\n\n`;
        });
        // Create blob and download
        const blob = new Blob([
            content
        ], {
            type: 'text/plain'
        });
        const url = window.URL.createObjectURL(blob);
        const link = document.createElement('a');
        link.href = url;
        link.download = filename.replace('.pdf', '.txt'); // For now, save as text
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
        window.URL.revokeObjectURL(url);
        return {
            success: true
        };
    } catch (error) {
        console.error('PDF export error:', error);
        return {
            success: false,
            error: error.message
        };
    }
};
const exportToExcel = async (data, filename = 'export.csv')=>{
    try {
        if (!data || data.length === 0) {
            throw new Error('No data to export');
        }
        // Get headers from first object
        const headers = Object.keys(data[0]);
        // Create CSV content
        let csvContent = headers.join(',') + '\n';
        data.forEach((row)=>{
            const values = headers.map((header)=>{
                const value = row[header];
                // Handle commas and quotes in values
                if (typeof value === 'string' && (value.includes(',') || value.includes('"'))) {
                    return `"${value.replace(/"/g, '""')}"`;
                }
                return value || '';
            });
            csvContent += values.join(',') + '\n';
        });
        // Create blob and download
        const blob = new Blob([
            csvContent
        ], {
            type: 'text/csv'
        });
        const url = window.URL.createObjectURL(blob);
        const link = document.createElement('a');
        link.href = url;
        link.download = filename;
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
        window.URL.revokeObjectURL(url);
        return {
            success: true
        };
    } catch (error) {
        console.error('Excel export error:', error);
        return {
            success: false,
            error: error.message
        };
    }
};
